  console.log("ver lo que har".viajes);

  return (
    <>
      <p>
        Lorem ipsum dolor sit, amet consectetur adipisicing elit. Ut illo ipsam
        enim quisquam voluptas natus rerum quasi! Nulla et nisi id distinctio,
        rerum neque? Necessitatibus quod est totam earum explicabo!
      </p>
      {viajes.map((viaje, index) => (
        <p >{viaje.omnibus}</p>
      ))}
    </>
  );
};

export default ViajesCrud;
